create table if not exists DOCS_PERMS(
    DOC_ID VARCHAR not null,
    USER_IDS ARRAY not null,
    USER_EMAILS ARRAY not null
);

create table if not exists DOCS_GROUPS(
    DOC_ID VARCHAR not null,
    GROUP_ID VARCHAR not null
);

CREATE OR REPLACE DYNAMIC TABLE DOC_GROUP_PERMS
  TARGET_LAG = 'DOWNSTREAM'
  WAREHOUSE = #{Snowflake Warehouse}
  REFRESH_MODE = incremental
  INITIALIZE = on_create
  AS SELECT DOC_ID, ARRAY_DISTINCT(ARRAY_FLATTEN(ARRAY_AGG(USER_IDS))) as group_user_ids, ARRAY_DISTINCT(ARRAY_FLATTEN(ARRAY_AGG(USER_EMAILS))) as group_emails FROM PERMS_GROUPS JOIN DOCS_GROUPS ON DOCS_GROUPS.GROUP_ID = perms_groups.group_id GROUP BY DOC_ID;

create table if not exists #{Snowflake File Hash Table Name} (
	HASH_VALUE VARCHAR,
	SOURCE_SYSTEM VARCHAR,
	DOC_ID VARCHAR,
	ALGORITHM VARCHAR
);

create stage if not exists #{Destination Stage}
    DIRECTORY = ( ENABLE = true )
    ENCRYPTION = ( TYPE = 'SNOWFLAKE_SSE' );

create table if not exists PERMS_GROUPS(
    GROUP_ID VARCHAR not null,
    METADATA OBJECT not null,
    USER_IDS ARRAY not null,
    USER_EMAILS ARRAY not null
);

SELECT DISTINCT DOC_ID FROM DOC_METADATA 
    WHERE FILE_ID = '${source.identifier}' 
    AND SOURCE = '${source.system}';

